import React from "react";
import GeoLocation from "../index";
import AppContainer from "../AppContainer";

const GetGeoLocation = props => {
  console.log("Geo", props);
  return <AppContainer lat={props.lat} />;
};

export default GeoLocation(GetGeoLocation);
